import React from 'react';
import TokenTransfer from './utils/TokenTransfer';
import logo from './assets/images/logo.png';  // Update with your logo's actual path

const App = () => {
  return (
    <div style={{ textAlign: 'center' }}>
      <img src={logo} alt="Logo" style={{ width: '150px', marginBottom: '20px' }} />
      <h1>Welcome to Token Transfer</h1>
      <TokenTransfer />
    </div>
  );
};

export default App;
